OfferShortResponse::BarcodeTypeEnum OfferShortResponse::toBarcodeTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("NONE")) {
        return BarcodeTypeEnum::NONE;
    }
    
    if (value == utility::conversions::to_string_t("UPC")) {
        return BarcodeTypeEnum::UPC;
    }
    
    if (value == utility::conversions::to_string_t("CODE_128")) {
        return BarcodeTypeEnum::CODE_128;
    }
    
    if (value == utility::conversions::to_string_t("QR")) {
        return BarcodeTypeEnum::QR;
    }
    
    if (value == utility::conversions::to_string_t("CUSTOM_MEDIA")) {
        return BarcodeTypeEnum::CUSTOM_MEDIA;
    }
    
    throw std::invalid_argument("Invalid value for conversion to BarcodeTypeEnum");
}


const utility::string_t OfferShortResponse::fromBarcodeTypeEnum(const BarcodeTypeEnum value) const
{
    switch(value)
    {
        
        case BarcodeTypeEnum::NONE: return utility::conversions::to_string_t("NONE");
        
        case BarcodeTypeEnum::UPC: return utility::conversions::to_string_t("UPC");
        
        case BarcodeTypeEnum::CODE_128: return utility::conversions::to_string_t("CODE_128");
        
        case BarcodeTypeEnum::QR: return utility::conversions::to_string_t("QR");
        
        case BarcodeTypeEnum::CUSTOM_MEDIA: return utility::conversions::to_string_t("CUSTOM_MEDIA");
        
    }
}

OfferShortResponse::SpecialOfferTypeEnum OfferShortResponse::toSpecialOfferTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("ALL")) {
        return SpecialOfferTypeEnum::ALL;
    }
    
    if (value == utility::conversions::to_string_t("RESERVABLE")) {
        return SpecialOfferTypeEnum::RESERVABLE;
    }
    
    if (value == utility::conversions::to_string_t("REGULAR_OFFER")) {
        return SpecialOfferTypeEnum::REGULAR_OFFER;
    }
    
    if (value == utility::conversions::to_string_t("ACT_NOW")) {
        return SpecialOfferTypeEnum::ACT_NOW;
    }
    
    if (value == utility::conversions::to_string_t("GET_THERE_NOW")) {
        return SpecialOfferTypeEnum::GET_THERE_NOW;
    }
    
    if (value == utility::conversions::to_string_t("SQOOT")) {
        return SpecialOfferTypeEnum::SQOOT;
    }
    
    if (value == utility::conversions::to_string_t("TICKETS")) {
        return SpecialOfferTypeEnum::TICKETS;
    }
    
    if (value == utility::conversions::to_string_t("YIPIT")) {
        return SpecialOfferTypeEnum::YIPIT;
    }
    
    throw std::invalid_argument("Invalid value for conversion to SpecialOfferTypeEnum");
}


